            "name": {
                "text": "Bookworms November 15th, 2019",
                "html": "Bookworms November 15th, 2019"
            },
            "description": {
                "text": "Bookworms Club:November 15th Bookworms!\nMiddle Readers! Join our Bookworms Book Club every third Friday month for author readings, pizza, and other fun activities! Come Friday, November 15th at 6:00 PM for a special local author visit from Aimee Lucido, to present her novel in verse Emmy in the Key of Code!\nABOUT THE BOOK: This is a novel in verse for middle readers! That means that this story is told in a series of poems. It's about a girl named Emmy, a middle school-er taking coding classes. Follow her story as she learns to find her voice and navigate middle school.\nRSVP REQUIRED by Thursday, November 14th. There is a $5 deposit to RSVP. If the child attends, the $5 will come back to them in the form of a store gift certificate. If they’re not able to attend or RSVP in advance, the money will be donated to The Children's Book Project, a foundation that builds literacy by providing free books to children.We're excited to see you the 15th!-EileenNext Up: We'll be taking a break for December, but we'll see you again in 2020!",
                "html": "<H2 CLASS=\"null\"><SPAN>Bookworms Club:<BR>November 15th Bookworms!</SPAN><BR></H2>\n<P><EM><STRONG>Middle Readers! </STRONG></EM>Join our Bookworms Book Club every third Friday month for author readings, pizza, and other fun activities! Come <STRONG>Friday, November 15th </STRONG>at <STRONG>6:00 PM</STRONG> for a special local author visit from <STRONG>Aimee Lucido, </STRONG>to present her novel in verse <EM><STRONG>Emmy in the Key of Code</STRONG></EM>!</P>\n<P>ABOUT THE BOOK: This is a novel in verse for middle readers! That means that this story is told in a series of poems. It's about a girl named Emmy, a middle school-er taking coding classes. Follow her story as she learns to find her voice and navigate middle school.</P>\n<P><BR><SPAN><SPAN><A HREF=\"http://tiny.cc/folioworms\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">RSVP REQUIRED by</A> Thursday, November 14</SPAN></SPAN><A HREF=\"http://tiny.cc/folioworms\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\"><SPAN><SPAN><STRONG>th. </STRONG></SPAN></SPAN></A><BR><BR>There is a $5 deposit to RSVP. If the child attends, the $5 will come back to them in the form of a store gift certificate. If they’re not able to attend or RSVP in advance, the money will be donated to The Children's Book Project, a foundation that builds literacy by providing free books to children.<BR><BR><SPAN>We're excited to see you the 15th!</SPAN><BR><BR>-Eileen<BR><BR><EM>Next Up: We'll be taking a break for December, but we'll see you again in 2020!</EM></P>"
            },
