            "name": {
                "text": "After That August - SF Book Launch",
                "html": "After That August - SF Book Launch"
            },
            "description": {
                "text": "\r\nPlease join us for the San Francisco book launch of After That August, a photographic memoir by artist, award-winning photographer, and writer, Michelle Yee.\r\n\r\n\r\n\r\n\r\n\r\n\r\nAfter That August is the intimate story of one woman's return to love after a divorce. It is a portrait of a moment in a time, presented through photography and personal reflections.\r\n \r\nThere will be a reading, followed by a Q&A with the artist.\r\n \r\nHand-finished, limited-edition copies of the book will be available for purchase and signing.\r\n \r\nRefreshments will be served.\r\n\r\n\r\n\r\n\r\n\r\n \r\n  \r\n \r\n\r\n \r\n \r\nMichelle Yee is an Asian-Canadian artist, award-winning photographer, writer, speaker, and independent author, now living in San Francisco. Michelle's personal work explores themes of identity, relationships and transformation. \r\n \r\nVisit her online at michelleyee.com\r\n \r\n \r\n \r\n \r\n \r\n\r\n \r\n \r\n \r\n ",
                "html": "<H2><BR></H2>\r\n<H2>Please join us for the San Francisco book launch of <EM>After That August</EM>, a photographic memoir by artist, award-winning photographer, and writer, Michelle Yee.</H2>\r\n<P><BR></P>\r\n<P><BR></P>\r\n<HR>\r\n<P><BR></P>\r\n<P><BR></P>\r\n<P><BR></P>\r\n<P><SPAN STYLE=\"font-size: medium; color: #333333;\"><EM>After That August </EM>is the intimate story of one woman's return to love after a divorce. It is a portrait of a moment in a time, presented through photography and personal reflections.<BR></SPAN></P>\r\n<P> </P>\r\n<P><SPAN STYLE=\"font-size: medium; color: #333333;\">There will be a reading, followed by a Q&A with the artist.</SPAN></P>\r\n<P> </P>\r\n<P><SPAN STYLE=\"font-size: medium; color: #333333;\">Hand-finished, limited-edition copies of the book will be available for purchase and <SPAN STYLE=\"font-size: medium; color: #333333;\">signing</SPAN>.</SPAN></P>\r\n<P> </P>\r\n<P><SPAN STYLE=\"font-size: medium; color: #333333;\">Refreshments will be served.</SPAN></P>\r\n<P><BR></P>\r\n<P><BR></P>\r\n<P><BR></P>\r\n<HR>\r\n<P><SPAN STYLE=\"font-size: medium;\"><BR></SPAN></P>\r\n<P> <BR></P>\r\n<P><SPAN STYLE=\"font-size: medium;\"> </SPAN> <BR></P>\r\n<P> </P>\r\n<P><SPAN STYLE=\"font-size: medium;\"><IMG STYLE=\"float: left; border: 5px solid black;\" ALT=\"Michelle Yee\" SRC=\"https://cdn.evbuc.com/eventlogos/72561791/michelleyeesmallsquarev2.jpg\" HEIGHT=\"240\" WIDTH=\"240\"></SPAN></P>\r\n<P> </P>\r\n<P> </P>\r\n<P STYLE=\"padding-left: 300px;\"><SPAN STYLE=\"font-size: medium;\">Michelle Yee is an Asian-Canadian artist, award-winning photographer, writer, speaker, and independent author, now living in San Francisco. Michelle's personal work explores themes of identity, relationships and transformation. </SPAN></P>\r\n<P STYLE=\"padding-left: 300px;\"> </P>\r\n<P STYLE=\"padding-left: 300px;\"><SPAN STYLE=\"font-size: medium;\">Visit her online at <A TITLE=\"michelleyee.com\" HREF=\"http://michelleyee.com\" TARGET=\"_blank\" REL=\"nofollow noopener noreferrer\">michelleyee.com</A></SPAN></P>\r\n<P> </P>\r\n<P> </P>\r\n<P> </P>\r\n<P> </P>\r\n<P> </P>\r\n<HR>\r\n<P> </P>\r\n<P> </P>\r\n<P> </P>\r\n<P> </P>"
            },
